import colorama
from colorama import Fore, init
import random
import string
import base64
init()

def obfusc(code):
    newcode = "\n" #EACH VALUE HERE IS SET FOR BEST RESULT. DO NOT MODIFY.  
    for _ in range(random.randint(2, 16)):
        cls_name = "".join(random.choice(string.ascii_letters) for _ in range(random.randint(8, 20)))
        newcode += f"class {cls_name}:\n"
        newcode += "    def __init__(self):\n"
        for _ in range(random.randint(3, 17)):
            var = "".join(random.choice(string.ascii_letters) for _ in range(random.randint(5,15)))
            newcode += f"        {var} = 0\n"
        newcode += "\n"
        for _ in range(random.randint(5, 175)):
            fn = "__" + "".join(random.choice(string.ascii_letters) for _ in range(random.randint(8,20)))
            params = ", ".join(
                "".join(random.choice(string.ascii_letters) for _ in range(random.randint(5,15)))
                for _ in range(random.randint(1,486))
            )
            newcode += f"    def {fn}(self, {params}):\n"
            for _ in range(random.randint(2, 17)):
                tmp = "".join(random.choice(string.ascii_letters) for _ in range(random.randint(5,15)))
                newcode += f"        {tmp} = 0\n"
            newcode += "        return None\n\n"
    newcode += code + "\n\n"

    for _ in range(random.randint(2, 74)):
        cls_name = "".join(random.choice(string.ascii_letters) for _ in range(random.randint(8, 20)))
        newcode += f"class {cls_name}:\n"
        newcode += "    def __init__(self):\n"
        for _ in range(random.randint(3, 327)):
            var = "".join(random.choice(string.ascii_letters) for _ in range(random.randint(5,15)))
            newcode += f"        {var} = 0\n"
        newcode += "\n"
        for _ in range(random.randint(5, 214)):
            fn = "__" + "".join(random.choice(string.ascii_letters) for _ in range(random.randint(8,20)))
            params = ", ".join(
                "".join(random.choice(string.ascii_letters) for _ in range(random.randint(5,15)))
                for _ in range(random.randint(1,8))
            )
            newcode += f"    def {fn}(self, {params}):\n"
            for _ in range(random.randint(2, 16)):
                tmp = "".join(random.choice(string.ascii_letters) for _ in range(random.randint(5,15)))
                newcode += f"        {tmp} = 0\n"
            newcode += "        return None\n\n"

    return newcode


